import React from "react";
import { HeaderFontPreview } from "./headerFont";
import { FontBox } from "./fontBox";

interface KhmerFontPreviewProps {
    previewText: string;
}

export const KhmerFont: React.FC<KhmerFontPreviewProps> = ({ previewText }) => {

    const khmertype = [
        "MyanmarAngoun",
        "MyanmarChatu",
        "MyanmarChatuLight",
        "MyanmarGantgaw",
        "MyanmarKhyay",
        "MyanmarKuttar",
        "MyanmarNayone",
        "MyanmarNjaun",
        "MyanmarPauklay",
        "MyanmarPhetsot",
        "MyanmarPhiksel",
        "MyanmarPhikselSmooth",
        "MyanmarPonenyet",
        "MyanmarSabae",
        "MyanmarSagar",
        "MyanmarSanpya",
        "MyanmarTagu",
        "MyanmarThuriya",
        "MyanmarWaso",
        "MyanmarYinmar"];

    return (
        <>
        <HeaderFontPreview title="Khmer Fonts"/>

            <ul>
            {khmertype.map((font, index) => (
                <li className="mb-8 border p-0">
                <FontBox fontName={font} previewText={previewText} />
                </li>
            ))}
            </ul>

        </>
    );
};
